DynamicPage.create!([
  {title: "Города Турции", descriptor: "project_categories", description: "<p>\n       У нас собраны лучшие предложения по недвижимости, расположенной в таких\n        известных курортных районах и городах Турции, как Аланья, Белек, Сиде, Анталья,\n        Кемер, Каш, Бодрум и иных привлекательных регионах южного побережья. Мы с радостью подберем для Вас небольшие «студио», просторные квартиры,\n        престижные апартаменты, шикарные пентхаузы, а также роскошные виллы и\n        дома.</p>\n        <p>\n        Почему это выгодно? Наше агентство представляет собственные проекты жилых комплексов,\n        застройщиком которых выступает крупная строительная компания «Торослар\n        Констракшн» (Toroslar Construction).  Это позволяет нам предлагать недвижимость по очень выгодным ценам от\n        застройщиков и на гибких условиях, включая возможности инвестирования на этапе\n        строительства.  Мы напрямую сотрудничаем с рядом ведущих строительных компаний\n        Анатолийского региона, с которыми придерживаемся политики «выгодно и удобно для\n        клиента». \n     </p>", meta_description: nil, meta_keywords: nil, meta_copyright: nil}
])
