Event.create!([
  {title: "Мы участники международной выставки в Бельгии 1", description: "<p>В нашем каталоге более 200 объектов недвижимости на побережье Средиземного и Эгейского морей.</p>\r\n\r\n<p>У нас собраны лучшие предложения по недвижимости, расположенной в таких известных курортных районах и городах Турции, как Аланья, Белек, Сиде, Анталья, Кемер, Каш, Бодрум и иных привлекательных регионах южного побережья. Мы с радостью подберем для Вас небольшие &laquo;студио&raquo;, просторные квартиры, престижные апартаменты, шикарные пентхаузы, а также роскошные виллы и дома.</p>\r\n\r\n<p>Почему это выгодно? Наше агентство представляет собственные проекты жилых комплексов, застройщиком которых выступает крупная строительная компания &laquo;Торослар Констракшн&raquo; (Toroslar Construction). Это позволяет нам предлагать недвижимость по очень выгодным ценам от застройщиков и на гибких условиях, включая возможности инвестирования на этапе строительства. Мы напрямую сотрудничаем с рядом ведущих строительных компаний Анатолийского региона, с которыми придерживаемся политики &laquo;выгодно и удобно для клиента&raquo;.</p>\r\n\r\n<p>Почему быстро? Наша команда профессионалов имеет большой опыт работы на рынке недвижимости Турции. Мы обеспечим законное, надежное и быстрое оформление документов на Вашу недвижимость в Турции.</p>\r\n", avatar: "nastol.com.ua_138324.jpg", date: "2015-05-28 08:24:59", lead: "this is a lead"},
