Post.create!([
  {post_category_id: 1, title: "Название полезной новости 1", text: "<p>У нас собраны лучшие предложения по недвижимости, расположенной в таких известных курортных районах и городах Турции, как Аланья, Белек, Сиде, Анталья, Кемер, Каш, Бодрум и иных привлекательных регионах южного побережья. Мы с радостью подберем для Вас небольшие &laquo;студио&raquo;, просторные квартиры, престижные апартаменты, шикарные пентхаузы, а также роскошные виллы и дома.</p>\r\n\r\n<p>Почему это выгодно? Наше агентство представляет собственные проекты жилых комплексов, застройщиком которых выступает крупная строительная компания &laquo;Торослар Констракшн&raquo; (Toroslar Construction). Это позволяет нам предлагать недвижимость по очень выгодным ценам от застройщиков и на гибких условиях, включая возможности инвестирования на этапе строительства. Мы напрямую сотрудничаем с рядом ведущих строительных компаний Анатолийского региона, с которыми придерживаемся политики &laquo;выгодно и удобно для клиента&raquo;.</p>\r\n", lead: "У нас собраны лучшие предложения по недвижимости, расположенной в таких известных курортных районах и городах Турции, как Аланья, Белек, Сиде, Анталья, Кемер, Каш, Бодрум и иных привлекательных регионах южного побережья. Мы с радостью подберем для Вас небольшие «студио», просторные квартиры, престижные апартаменты, шикарные пентхаузы, а также роскошные виллы и дома.  Мы с радостью подберем для Вас небольшие «студио», просторные квартиры, престижные апартаменты, шикарные пентхаузы, а также роскошные виллы и дома. ", meta_title: "", meta_description: "", meta_keywords: "", to_main_page: true, mini_lead: "Порядок выплаты пенсий гражданам проживающим за пределами РФ несколько изменился.\n          Украинцы покупая недвижимость в Турции используют сбережения из личных средств. Украинцы покупая недвижимость в Турции используют сбережения из личных средств", avatar: "nastol.com.ua_138324.jpg"},
